    [k.INTRODUCTION]: `1. INTRODUCTION`,
    [k.THIS_PRIVACY_NOTICE_DESCRIBES]: `This privacy notice describes how DropWorks, Inc. DropWorks, Inc. 4730 S. Fort Apache Road Suite 300, Las Vegas, NV 89147 - 7947, USA. (\u00e2\u20ac\u0153DropWorks, Inc., \u00e2\u20ac\u0153we, \u00e2\u20ac\u0153our, \u00e2\u20ac\u0153us) collects and uses your personal data. It tells you what to expect us to do with your personal data if you are engaged (or might be engaged) with us as a \u00e2\u20ac\u0153Participant (e.g. as a composer, producer, lyricist, vocalist and video producer) to the creation of music and sound effects (\u00e2\u20ac\u0153Drops) and stream it to public streaming platforms (\u00e2\u20ac\u0153Drop). It further describes the rights you may have in relation to our use of your data and how to exercise those rights.`,
    [k.AS_A_DATA_CONTROLLER_WE_MUST]: `As a data controller, we must ensure that we use your personal data in compliance with applicable privacy and data protection laws (primarily the General Data Protection Regulation (EU) 2016/679, the \u00e2\u20ac\u0153GDPR) and to protect your personal data accordingly. If you have questions or concerns regarding how we fulfil our obligations, you are welcome to Contacte con nosotros at the address below.`,
    [k.WE_MAY_UPDATE_THIS_PRIVACY_NOT]: `We may update this privacy notice from time to time. At the top of the page, you can see the last date when this was made.`,
