    [k.IN_ORDER_FOR_DROPWORKS_TO_BE_A]: `In order for DropWorks to be able to manage our relationship with you as a Participant, we collect and process your personal data as further explained below.`,
    [k.THE_PERSONAL_DATA_WE_USE_IS_PR]: `The personal data we use is primarily collected directly from you prior to becoming a Participant in order to evaluate whether you are a potential match with us, and then throughout the time you work with us, e.g. in the context of planning and creating ca\u00eddas, commercially promoting and distributing Drops or following up on your performance as a Participant.`,
