    [k.WE_ENGAGE_THIRD_PARTY_SERVICE]: `We engage third pArtey service providers who will receive and process your personal data, subject to the data protection obligations or other agreements or arrangements we apply for such situations. Such third party service providers are typically necessary to operate our website and Services, such as technical infrastructure service providers and analytics service providers.They also include external consultancy services such as accounting services and legal services.`,
