    [k.IF_YOU_OR_DROPWORKS_INC_TERM]: `If you or DropWorks, Inc. terminate this agreement for any reason or if you violate any of the terms or  conditions in these Terms and Conditions or any thereto related documents, your right to use the Service and  access to Artwork, PROYECTO and Drop will immediately terminate. DropWorks, Inc. may further, at its sole  discretion, terminate your account and your access to the Service with immediate effects.`,
    [k.ASSIGNMENT]: `16. Assignment`,
