    [k.PARTIAL_INVALIDITY]: `17. PArteial Invalidity`,
    [k.IF_ANY_PROVISION_OF_THESE_TERM]: `If any provision of these Terms and Conditions shall be invalid or unenforceable, at any time or to any  extent, then the remainder of these Terms and Conditions shall not be affected thereby. Each provision of  these Terms and Conditions shall be valid and enforced to the fullest extent permitted by law.`,
    [k.LAW_AND_DISPUTE_RESOLUTION]: `18. Law and Dispute Resolution`,
