    [k.DROPWORKS_INC_HAS_THE_RIGHT]: `DropWorks, Inc. has the right regarding illegal copying or distribution of the Artwork, the PROYECTO, the  Drop or the Service to the public, to instigate proceedings for damages or injunctions in any court having  jurisdiction.`,
